import MenuTopo from "./componentes/MenuTopo";
import Botao from "./componentes/Botao";
import './componentes/EspacoBotoes/EspacoBotoes.css'
function App() {

  const jogos = [
    {
      nome: 'Não Nomeado',
      imagem: '/imagens/grazinha.png'
    },
    {
      nome: 'Dash and Get Out',
      imagem: '/imagens/dashAndGetOut.png'
    },
    {
      nome: 'Square Problems',
      imagem: '/imagens/squareProblems.png'
    },
    {
      nome: 'Pech',
      imagem: '/imagens/pech.png'
    }
  ]

  return (
    <div className="App">
      <MenuTopo/>

      <div className="espaco-botoes">
        {jogos.map(jogo => <Botao key={jogo.nome} nome={jogo.nome} imagem={jogo.imagem}/>)}
      </div>


    </div>
  );
}

export default App;
